const sign = parcel.getFeatureById('lazlo-sign')
const greeting = "Welcome, are you ready to order? While you're thinking, could you help me find my guestbook, I think I left it upstairs. If you sign it, I'll give you a treat..."


feature.on('trigger', () => {
  sign.set({text: greeting, blendMode: 'combine'})

  setTimeout(() => {
    sign.set({text: '', blendMode: 'Multiply'})
  }, 3000)
})

const audio = parcel.getFeatureById('rickroll-audio');
const pizzaMusic = parcel.getFeatureById('pizza-music');
const sign = parcel.getFeatureById('rickroll-sign');
const message =
  'OK, got you! The real guestbook is in the basement. Sign in to get a gift sent to your wallet.';

feature.on('click', () => {
  pizzaMusic.set({ volume: 0 });
  audio.set({ volume: 1 });
  audio.play();
  sign.set({ text: message, blendMode: 'combine' });

  const fadeOut = () => {
    let vol1 = 0.8;
    let vol2 = 0.2;

    for (let i = 0; i < 5; i++) {
      setTimeout(() => {
        audio.set({ volume: vol1 });
        pizzaMusic.set({ volume: vol2 });
        vol1 -= 0.2;
        vol2 += 0.2;
      }, i * 1000);
    }
  };

  setTimeout(() => {
    sign.set({ text: '', blendMode: 'Multiply' });
    fadeOut();
  }, 25000);

  setTimeout(() => {
    audio.stop();
  }, 30000);
});

const audio = parcel.getFeatureById('mamma-mia')

feature.on('trigger', () => {
  audio.set({volume: 1})
  audio.play()
})

let player,
  frame,
  bullets,
  asteroids,
  score,
  asteroidLimit,
  oldLimit,
  checked,
  playerName,
  highScore,
  shotsFired;

const sign = parcel.getFeatureById('high-score');

const blue = [0, 128, 255];
const red = [255, 51, 51];
const green = [0, 204, 0];
const yellow = [255, 215, 0];
const orange = [255, 69, 0];
const black = [0, 0, 0];
const white = [255, 255, 255];
const playerSpeed = 2;

const LEFT = 'LEFT';
const RIGHT = 'RIGHT';
const BOTH = 'BOTH';

// main loop functions

feature.on('keys', (e) => {
  if (!player) {
    return;
  }

  if (e.keys.left) {
    player.xVel = -1 * playerSpeed;
  } else if (e.keys.right) {
    player.xVel = playerSpeed;
  } else {
    player.xVel = 0;
  }

  if (e.keys.a) {
    if (
      bullets.length == 0 ||
      frame - bullets[bullets.length - 1].timeBorn > 5
    ) {
      fireWeapon();
    }
  }
});

feature.on('start', (e) => {
  playerName = parcel.getPlayers()[0].name;
  reset();
});

feature.on('frame', (e) => {
  frame += 1;
  update();
  draw();
});

function resetDelay() {
  if (frame - player.diedAt > 200) {
    reset();
  }
}

function resetShotsFired() {
  if (frame - player.lastFired > 30) {
    shotsFired = 0;
  }
}

function fireWeapon() {
  if (shotsFired < 6 && frame - player.lastFired > 15) {
    shotsFired = 0;
    player.shoot();
  } else if (shotsFired < 4) {
    player.shoot();
  } else {
    resetShotsFired();
  }
}

function update() {
  if (frame % 2 == 0) {
  }
  if (player.health <= 0) {
    resetDelay();
  } else {
    player.update();

    let inactiveBullets = [];
    for (let i = 0; i < bullets.length; i++) {
      bullets[i].update();
      if (!bullets[i].active) {
        inactiveBullets.push(i);
      }
    }
    for (let i = 0; i < inactiveBullets.length; i++) {
      bullets.splice(inactiveBullets[i] - i, 1);
    }

    if (asteroidLimit > oldLimit) {
      asteroids.push(
        new Asteroid(
          2 * Math.round(Math.random() * 31),
          -1 * Math.round(Math.random() * asteroidLimit),
          0
        )
      );
      oldLimit = asteroidLimit;
    }
    for (let i = 0; i < asteroids.length; i++) {
      asteroids[i].update();
      if (!asteroids[i].active) {
        asteroids[i].reset();
      }
    }
  }
}

function draw() {
  if (player.health == 0 && frame - player.diedAt < 100) {
    drawSkull();
  } else if (player.health == 0 && frame - player.diedAt <= 200) {
    checkScore();
    drawScore(6, 10, score);
  } else {
    feature.screen.fill(0);
    player.draw();
    bullets.forEach((bullet) => {
      bullet.draw();
    });
    asteroids.forEach((asteroid) => {
      asteroid.draw();
    });
  }
}

function reset() {
  getScore();
  checked = false;
  score = 0;
  frame = 0;
  asteroidLimit = 1;
  oldLimit = 1;
  shotsFired = 0;
  player = new Player(30, 58);
  bullets = [];

  asteroids = [];
  for (let i = 0; i < asteroidLimit; i++) {
    asteroids.push(
      new Asteroid(
        2 * Math.round(Math.random() * 31),
        -1 * Math.round(Math.random() * asteroidLimit),
        0
      )
    );
  }

  draw();
}

// helper functions

function getScore() {
  fetch(
    'https://cv-highscores.s3.us-east-2.amazonaws.com/classic_asteroids.json'
  )
    .then((response) => response.json())
    .then((data) => {
      highScore = data;
    });
}

function checkScore() {
  if (!checked) {
    checked = true;
    const values = Object.values(highScore);
    for (let i = 0; i < values.length; i++) {
      if (score >= values[i].score) {
        highScore[i + 1].score = score;
        highScore[i + 1].name = playerName;

        const text = `
 | 1.   ----- ${highScore[1].name}    -------- ${highScore[1].score}

 | 2.   ----- ${highScore[2].name}    -------- ${highScore[2].score}

 | 3.   ----- ${highScore[3].name}    -------- ${highScore[3].score}
  `;

        sign.set({ text: text });

        fetch(
          'https://cv-highscores.s3.us-east-2.amazonaws.com/classic_asteroids.json',
          {
            method: 'PUT',
            headers: {
              'Content-Type': 'application/json',
            },
            body: JSON.stringify(highScore),
          }
        )
          .then((response) => response.json())
          .then((data) => {
            console.log('Success:', data);
          })
          .catch((error) => {
            console.error('Error:', error);
          });
        return;
      }
    }
  }
}

function drawPixel(x, y, rgb) {
  if (rgb.length != 3) {
    return;
  }

  for (let z = 0; z < rgb.length; z++) {
    feature.screen[y * feature.screenWidth * 3 + x * 3 + z] = rgb[z];
  }
}

function drawBlock(x, y, rgb, size) {
  for (let u = 0; u < size; u++) {
    for (let r = 0; r < size; r++) {
      drawPixel(x + u, y + r, rgb);
    }
  }
}

function drawRectangle(x, y, rgb, width, height) {
  for (let u = 0; u < width; u++) {
    for (let r = 0; r < height; r++) {
      drawPixel(x + u, y + r, rgb);
    }
  }
}

function drawSkull() {
  feature.screen.fill(0);
  // skull bg
  drawRectangle(24, 10, white, 14, 2);
  drawRectangle(20, 12, white, 22, 2);
  drawRectangle(18, 14, white, 26, 2);
  drawRectangle(16, 16, white, 30, 4);
  drawRectangle(14, 20, white, 34, 14);
  drawRectangle(16, 34, white, 30, 2);
  drawRectangle(18, 36, white, 26, 2);
  drawRectangle(20, 38, white, 22, 2);
  drawRectangle(22, 40, white, 18, 4);
  // eyes
  drawRectangle(20, 20, red, 6, 8);
  drawRectangle(36, 20, red, 6, 8);
  // nose
  drawRectangle(28, 30, red, 2, 4);
  drawRectangle(32, 30, red, 2, 4);
  // teeth
  drawBlock(22, 42, red, 2);
  drawRectangle(26, 40, red, 2, 4);
  drawRectangle(30, 40, red, 2, 4);
  drawRectangle(34, 40, red, 2, 4);
  drawBlock(38, 42, red, 2);
}

function drawScore(x, y, score) {
  feature.screen.fill(0);
  // s
  drawRectangle(x, y, white, 4, 2);
  drawBlock(x, y + 2, white, 2);
  drawRectangle(x, y + 4, white, 4, 2);
  drawBlock(x + 2, y + 6, white, 2);
  drawRectangle(x, y + 8, white, 4, 2);
  // c
  drawRectangle(x + 6, y, white, 4, 2);
  drawRectangle(x + 6, y + 2, white, 2, x);
  drawRectangle(x + 6, y + 8, white, 4, 2);
  // o
  drawRectangle(x + 12, y, white, 4, 2);
  drawRectangle(x + 12, y + 2, white, 1, 6);
  drawRectangle(x + 15, y + 2, white, 1, 6);
  drawRectangle(x + 12, y + 8, white, 4, 2);
  // r
  drawRectangle(x + 18, y, white, 4, 2);
  drawRectangle(x + 18, y + 2, white, 2, 8);
  // e
  drawRectangle(x + 24, y, white, 4, 2);
  drawRectangle(x + 24, y + 2, white, 2, 6);
  drawRectangle(x + 24, y + 4, white, 4, 2);
  drawRectangle(x + 24, y + 8, white, 4, 2);
  // :
  drawBlock(x + 32, y + 2, white, 2, 2);
  drawBlock(x + 32, y + 6, white, 2, 2);

  if (score > 10) {
    const digits = score.toString().split('');
    one = numbers[parseInt(digits[0])];
    two = numbers[parseInt(digits[1])];

    one(x + 38, y);
    two(x + 44, y);
  } else {
    _score = numbers[score];
    _score(x + 38, y);
  }
}

